window.bookSummaryJSON = "<p><b>I'm the heir of Zahariss.</b></p> <p>My secret is no more, and the people know an heir walks amongst them, but so does another.</p> <p>With broken vows and being hunted, I find myself in the most unlikely place of allies that will help me to right the wrong.</p> <p>As we make plans to spill the Highers' blood across the land, he finds me. Darius, heir of Cazier.</p> <p>After thinking we had some sort of connection, a truce, my enemy betrayed me.</p> <p>He says he won't let me go, but he won't acknowledge what he has done to me.</p> <p>With hatred burning bright, can we move on? Or will my wounds stay forever bleeding?</p> <p>While uncovering more of the Highers' traitorous actions, and learning just how far they will go to gain their wishes...</p> <p>The dark is rising, and we have to stop it. I just have to work with the enemy to find out how.</p> <p><i>This is the second book in The Hidden of Vrohkaria series and ends on a cliffhanger. This is a first-person, MF, enemies-to-lovers, dark fantasy romance for mature listeners.</i></p>"; 
